import Link from 'next/link';


const linkStyle = {
  marginRight: 15
};

const Header = () => (
<header>
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about" color="inherit">
          <a>About</a>
        </Link>
      </li>
    </ul>
  </header>
);

export default Header;
